y\",\n                  \"value\" : \"Data are updated daily\"\n                },\n                {\n                  \"key\" : \"Metadata_Data-Owner\",\n                  \"value\" : \"Department of Buildings\"\n                },\n                {\n                  \"key\" : \"Metadata_Time-Period\",\n                  \"value\" : \"2006 to present\"\n                },\n                {\n                  \"key\" : \"Metadata_Changes-and-Other-Historical-Information-Useful-to-Understanding-This-Dataset\",\n                  \"value\" : \"https://www.google.com/search?as_q=%22Related+dataset+ID+s%22+%22ydr8+5enu%22+inurl%3Astories&as_sitesearch=data.cityofchicago.org\"\n                }\n              ]\n          },\n        \"metadata\" :\n          {\n            \"domain\" : \"data.cityofchicago.org\",\n            \"license\" : \"See Terms of Use\"\n          },\n        \"permalink\" : \"https://data.cityofchicago.org/d/ydr8-5enu\",\n        \"link\" : \"https://data.cityofchicago.org/Buildings/Building-Permits/ydr8-5enu\",\n        \"owner\" :\n          {\n            \"id\" : \"scy9-9wg4\",\n            \"user_type\" : \"interactive\",\n            \"display_name\" : \"cocadmin\"\n          },\n        \"creator\" :\n          {\n            \"id\" : \"scy9-9wg4\",\n            \"user_type\" : \"interactive\",\n            \"display_name\" : \"cocadmin\"\n          }\n      },\n      {\n        \"resource\" :\n          {\n            \"name\" : \"Traffic Crashes - Crashes\",\n            \"id\" : \"85ca-t3if\",\n            \"resource_name\" : null,\n            \"parent_fxf\" : [],\n            \"description\" : \"Crash data shows information about each traffic crash on city streets within the City of Chicago limits and under the jurisdiction of Chicago Police Department (CPD). Data are shown as is from the electronic crash reporting system (E-Crash) at CPD, excluding any personally identifiable information. Records are added to the data portal when a crash report is finalized or when amendments are made to an existing report in E-Crash. Data from E-Crash are available for some police districts in 2015, but citywide data are not available until September 2017. About half of all crash reports, mostly minor crashes, are self-reported at the police district by the driver(s) involved and the other half are recorded at the scene by the police officer responding to the crash. Many of the crash parameters, including street condition data, weather condition, and posted speed limits, are recorded by the reporting officer based on best available information at the time, but many of these may disagree with posted information or other assessments on road conditions. If any new or updated information on a crash is received, the reporting officer may amend the crash report at a later time. A traffic crash within the city limits for which CPD is not the responding police agency, typically crashes on interstate highways, freeway ramps, and on local roads along the City boundary, are excluded from this dataset.\\n\\nAll crashes are recorded as per the format specified in the Traffic Crash Report, SR1050, of the Illinois Department of Transportation. The crash data published on the Chicago data portal mostly follows the data elements in SR1050 form. The current version of the SR1050 instructions manual with detailed information on each data elements is available <a href=\\\"https://idot.illinois.gov/Assets/uploads/files/Transportation-System/Manuals-Guides-&-Handbooks/Safety/Illinois Traffic Crash Report SR 1050 Instruction Manual 2019.pdf\\\">here</a>.\\n\\nAs per Illinois statute, only crashes with a property damage value of $1,500 or more or involving bodily injury to any person(s) and that happen on a public roadway and that involve at least one moving vehicle, except bike dooring, are considered reportable crashes. However, CPD records every reported traffic crash event, regardless of the statute of limitations, and hence any formal Chicago crash dataset released by Illinois Department of Transportation may not include all the crashes listed here.\\n\\nChange 11/21/2023: We have removed the RD_NO (Chicago Police Department report number) for privacy reasons.\",\n            \"attribution\" : \"City of Chicago\",\n            \"attribution_link\" : \"http://www.chicago.gov\",\n            \"contact_email\" : null,\n            \"type\" : \"dataset\",\n            \"updatedAt\" : \"2025-07-22T15:44:59.000Z\",\n            \"createdAt\" : \"2017-10-19T22:02:56.000Z\",\n            \"metadata_updated_at\" : \"2023-12-13T16:58:25.000Z\",\n            \"data_updated_at\" : \"2025-07-22T15:44:59.000Z\",\n            \"page_views\" :\n              {\n                \"page_views_last_week\" : 4249,\n                \"page_views_last_month\" : 17637,\n                \"page_views_total\" : 659508,\n                \"page_views_last_week_log\" : 12.053247125912428,\n                \"page_views_last_month_log\" : 14.106399360305144,\n                \"page_views_total_log\" : 19.331032821808662\n              },\n            \"columns_name\" :\n              [\n                \"DOORING_I\",\n                \"LOCATION\",\n                \"LONGITUDE\",\n                \"LATITUDE\",\n                \"CRASH_MONTH\",\n                \"CRASH_DAY_OF_WEEK\",\n                \"CRASH_HOUR\",\n                \"INJURIES_UNKNOWN\",\n                \"INJURIES_NO_INDICATION\",\n                \"INJURIES_REPORTED_NOT_EVIDENT\",\n                \"INJURIES_NON_INCAPACITATING\",\n                \"INJURIES_INCAPACITATING\",\n                \"INJURIES_FATAL\",\n                \"INJURIES_TOTAL\",\n                \"MOST_SEVERE_INJURY\",\n                \"NUM_UNITS\",\n                \"WORKERS_PRESENT_I\",\n                \"WORK_ZONE_TYPE\",\n                \"WORK_ZONE_I\",\n                \"STATEMENTS_TAKEN_I\",\n                \"PHOTOS_TAKEN_I\",\n                \"BEAT_OF_OCCURRENCE\",\n  