" : \"interactive\",\n            \"display_name\" : \"cocadmin\"\n          }\n      },\n      {\n        \"resource\" :\n          {\n            \"name\" : \"Business Licenses\",\n            \"id\" : \"r5kz-chrr\",\n            \"resource_name\" : null,\n            \"parent_fxf\" : [],\n            \"description\" : \"NOTE, 2/21/2025 - We have <a href=\\\"https://data.cityofchicago.org/stories/s/yu97-as3j\\\" target=\\\"_blank\\\">added</a> three geographic columns to this dataset.\\n\\nBusiness licenses issued by the Department of Business Affairs and Consumer Protection in the City of Chicago from 2002 to the present. This dataset contains a large number of records/rows of data and may not be viewed in full in Microsoft Excel. Therefore, when downloading the file, select CSV from the Export menu. Open the file in an ASCII text editor, such as Notepad or Wordpad, to view and search. \\n \\nData fields requiring description are detailed below. \\n\\nAPPLICATION TYPE:  ‘ISSUE’ is the record associated with the initial license application.  ‘RENEW’ is a subsequent renewal record.  All renewal records are created with a term start date and term expiration date.  ‘C_LOC’ is a change of location record.  It means the business moved.   ‘C_CAPA’ is a change of capacity record.  Only a few license types may file this type of application.  ‘C_EXPA’ only applies to businesses that have liquor licenses.  It means the business location expanded.  'C_SBA' is a change of business activity record. It means that a new business activity was added or an existing business activity was marked as expired.\\n\\nLICENSE STATUS: ‘AAI’ means the license was issued. ‘AAC’ means the license was cancelled during its term.  ‘REV’ means the license was revoked. 'REA' means the license revocation has been appealed.\\n\\nLICENSE STATUS CHANGE DATE:  This date corresponds to the date a license was cancelled (AAC), revoked (REV) or appealed (REA).\\n\\nBusiness License Owner information may be accessed at:  https://data.cityofchicago.org/dataset/Business-Owners/ezma-pppn. To identify the owner of a business, you will need the account number or legal name, which may be obtained from this Business Licenses dataset. \\n\\nData Owner: Business Affairs and Consumer Protection. Time Period: January 1, 2002 to present. Frequency: Data is updated daily.\",\n            \"attribution\" : \"City of Chicago\",\n            \"attribution_link\" : \"http://www.cityofchicago.org\",\n            \"contact_email\" : null,\n            \"type\" : \"dataset\",\n            \"updatedAt\" : \"2025-07-22T10:08:29.000Z\",\n            \"createdAt\" : \"2011-09-27T16:03:34.000Z\",\n            \"metadata_updated_at\" : \"2025-02-21T21:42:37.000Z\",\n            \"data_updated_at\" : \"2025-07-22T10:08:29.000Z\",\n            \"page_views\" :\n              {\n                \"page_views_last_week\" : 838,\n                \"page_views_last_month\" : 3685,\n                \"page_views_total\" : 297959,\n                \"page_views_last_week_log\" : 9.712527000439824,\n                \"page_views_last_month_log\" : 11.847840355630714,\n                \"page_views_total_log\" : 18.18475914178536\n              },\n            \"columns_name\" :\n              [\n                \"LOCATION (zip)\",\n                \"CITY\",\n                \"POLICE DISTRICT\",\n                \"PRECINCT\",\n                \"STATE\",\n                \"LOCATION (state)\",\n                \"SITE NUMBER\",\n                \"LEGAL NAME\",\n                \"COMMUNITY AREA NAME\",\n                \"APPLICATION REQUIREMENTS COMPLETE\",\n                \"LICENSE STATUS\",\n                \"LICENSE TERM START DATE\",\n                \"SSA\",\n                \"WARD\",\n                \"WARD PRECINCT\",\n                \"NEIGHBORHOOD\",\n                \"LICENSE CODE\",\n                \"LICENSE DESCRIPTION\",\n                \"BUSINESS ACTIVITY ID\",\n                \"LICENSE NUMBER\",