       \"application_type\",\n                \"expiration_date\",\n                \"location_city\",\n                \"location_address\",\n                \"latitude\",\n                \":@computed_region_awaf_s7ux\",\n                \":@computed_region_vrxf_vc4k\",\n                \"doing_business_as_name\",\n                \"payment_date\",\n                \"business_activity\",\n                \":@computed_region_bdys_3d7i\",\n                \"id\",\n                \"conditional_approval\",\n                \":@computed_region_6mkv_f3dw\",\n                \"longitude\",\n                \"address\",\n                \"account_number\",\n                \":@computed_region_43wa_7qmu\",\n                \"community_area\",\n                \"license_id\",\n                \"zip_code\"\n              ],\n            \"columns_datatype\" :\n              [\n                \"Text\",\n                \"Text\",\n                \"Number\",\n                \"Number\",\n                \"Text\",\n                \"Text\",\n                \"Number\",\n                \"Text\",\n                \"Text\",\n                \"Calendar date\",\n                \"Text\",\n                \"Calendar date\",\n                \"Text\",\n                \"Number\",\n                \"Text\",\n                \"Text\",\n                \"Number\",\n                \"Text\",\n                \"Text\",\n                \"Number\",\n                \"Calendar date\",\n                \"Calendar date\",\n                \"Calendar date\",\n                \"Calendar date\",\n                \"Point\",\n                \"Text\",\n                \"Calendar date\",\n                \"Text\",\n                \"Text\",\n                \"Number\",\n                \"Number\",\n                \"Number\",\n                \"Text\",\n                \"Calendar date\",\n                \"Text\",\n                \"Number\",\n                \"Text\",\n                \"Text\",\n                \"Number\",\n                \"Number\",\n                \"Text\",\n                \"Number\",\n                \"Number\",\n                \"Number\",\n                \"Number\",\n                \"Text\"\n              ],\n            \"columns_description\" :\n              [\n                \"\",\n                \"\",\n                \"\",\n                \"The precinct within the ward where the business is located. Note the the same precinct numbers exist in multiple wards.\",\n                \"\",\n                \"\",\n                \"An internal database ID indicating the location of this licensed business to account for business owners with more than one location.\",\n                \"\",\n                \"Community Area Name\",\n                \"For all application types except RENEW, this is the date all required application documents were received.  For RENEW type records, this is the date the record was created.\",\n                \"See the dataset description for the codes used.\",\n                \"\",\n                \"Special Service Areas  are local tax districts that fund expanded services and programs, to foster commercial and economic development, through a localized property tax. In other cities these areas are sometimes called Business Improvement Districts (BIDs). This portal contains a map of all Chicago SSAs\",\n                \"The ward where the business is located.\",\n                \"The ward and precinct where the business is located. This column can be used to filter by precinct more easily across multiple wards. \",\n                \"\",\n                \"A code for the type of license. Each code value corresponds to a specific LICENSE DESCRIPTION value.\",\n                \"\",\n                \"A code for the business activity. Each ID value corresponds to a specific BUSINESS ACTIVITY value.\",\n                \"The license number known to the public and generally used in other data sources that refer to the license. This is the field most users will want for most purposes. Each license has a single license number that stays consistent throughout the lifetime of the license. By contrast, the LICENSE ID field is an internal database ID and not generally useful to external users.\",\n                \"The date the business license application was created.  RENEW type records do not have an application.\",\n                \"This is the date the license was ready for issuance. Licenses may not be issued if the customer owes debt to the City. \",\n                \"\",\n                \"\",\n                \"\",\n                \"\",\n                \"\",\n                \"\",\n                \"\",\n                \"\",\n                \"\",\n                \"\",\n                \"\",\n                \"\",\n                \"\",\n                \"\",\n                \"A calculated ID for each record.\",\n                \"This pertains to applications that contain liquor licenses. Customers may request a conditional approval prior to building out the space.\",\n                \"\",\n                \"\",\n                \"\",\n                \"The account number of the business owner, which will stay consistent across that owner's licenses and can be used to find the owner in the Business Owners dataset.\",\n                \"\",\n                \"Community Area Number\",\n                \"An internal database ID for each record.  Each license can have multiple records as it goes through renewals and other transactions.  See the LICENSE NUMBER field for the number generally known to the public and used in most other data sources that refer to the license.\",\n                \"\"\n              ],\n            \"columns_format\" :\n              [\n                {},\n                {},\n                {\n                  \"precisionStyle\" : \"standard\",\n                  \"noCommas\" : \"true\",\n                  \"align\" : \"