\n                  \"value\" : \"https://www.google.com/search?as_q=%22Related+dataset+ID+s%22+%22r5kz-chrr%22+inurl%3Astories&as_sitesearch=data.cityofchicago.org\"\n                }\n              ]\n          },\n        \"metadata\" :\n          {\n            \"domain\" : \"data.cityofchicago.org\",\n            \"license\" : \"See Terms of Use\"\n          },\n        \"permalink\" : \"https://data.cityofchicago.org/d/r5kz-chrr\",\n        \"link\" : \"https://data.cityofchicago.org/Community-Economic-Development/Business-Licenses/r5kz-chrr\",\n        \"owner\" :\n          {\n            \"id\" : \"scy9-9wg4\",\n            \"user_type\" : \"interactive\",\n            \"display_name\" : \"cocadmin\"\n          },\n        \"creator\" :\n          {\n            \"id\" : \"scy9-9wg4\",\n            \"user_type\" : \"interactive\",\n            \"display_name\" : \"cocadmin\"\n          }\n      },\n      {\n        \"resource\" :\n          {\n            \"name\" : \"Building Violations\",\n            \"id\" : \"22u3-xenr\",\n            \"resource_name\" : null,\n            \"parent_fxf\" : [],\n            \"description\" : \"Violations issued by the Department of Buildings from 2006 to the present.  Lenders and title companies, please note: These data are historical in nature and should not be relied upon for real estate transactions. For transactional purposes such as closings, please consult the title commitment for outstanding enforcement actions in the Circuit Court of Cook County or the Chicago Department of Administrative Hearings. Violations are always associated to an inspection and there can be multiple violation records to one inspection record. Related Applications: Building Data Warehouse http://www.cityofchicago.org/city/en/depts/bldgs/provdrs/inspect/svcs/building_violationsonline.html. The information presented on this website is informational only and does not necessarily reflect the current condition of the building or property. The dataset contains cases where a respondent has been found to be liable as well as cases where the respondent has been found to be not liable.\",\n            \"attribution\" : \"City of Chicago\",\n            \"attribution_link\" : \"http://www.cityofchicago.org\",\n            \"contact_email\" : null,\n            \"type\" : \"dataset\",\n            \"updatedAt\" : \"2025-07-22T07:31:40.000Z\",\n            \"createdAt\" : \"2012-06-26T17:28:59.000Z\",\n            \"metadata_updated_at\" : \"2023-01-05T15:55:21.000Z\",\n            \"data_updated_at\" : \"2025-07-22T07:31:40.000Z\",\n            \"page_views\" :\n              {\n                \"page_views_last_week\" : 962,\n                \"page_views_last_month\" : 4351,\n                \"page_views_total\" : 290421,\n                \"page_views_last_week_log\" : 9.91139198784346,\n                \"page_views_last_month_log\" : 12.087462841250339,\n                \"page_views_total_log\" : 18.147791218709575\n              },\n            \"columns_name\" :\n              [\n                \"STREET NAME\",\n                \"PROPERTY GROUP\",\n                \"VIOLATION CODE\",\n                \"LONGITUDE\",\n                \"VIOLATION DESCRIPTION\",\n                \"VIOLATION DATE\",\n                \"INSPECTOR ID\",\n                \"INSPECTION STATUS\",\n                \"SSA\",\n                \"ADDRESS\",\n                \"VIOLATION LOCATION\",\n                \"LOCATION (state)\",\n                \"LOCATION (city)\",\n                \"INSPECTION NUMBER\",\n                \"ID\",\n                \"STREET NUMBER\",\n                \"DEPARTMENT BUREAU\",\n                \"LOCATION\",\n                \"VIOLATION STATUS DATE\",\n                \"INSPECTION WAIVED\",\n                \"LOCATION (zip)\",\n                \"LATITUDE\",\n                \"STREET TYPE\",\n                \"INSPECTION CATEGORY\",\n                \"VIOLATION STATUS\",\n                \"LOCATION (address)